import React,{useState} from "react";
import { Link } from "react-router-dom";
import { ToastContainer, toast } from "react-toastify";

function Login() {
  const [values, setValues] = useState({
    name:"",
    email:"",
    password:"",
  });

  const handleSubmit = (e)=>{
    e.preventDefault()
  }

  return (
    <div className="CardBody">
      <div className="container">
        <h2>Login Account</h2>
        <form action="" onSubmit={(e)=>handleSubmit(e)}>
         
          <div>
            <label htmlFor="email">Email</label>
            <input type="email" name="email" placeholder="Enter your Email" onChange={(e)=>setValues({...values,[e.target.name]: e.target.value})} />
          </div>
          <div>
            <label htmlFor="password">Password</label>
            <input
              type="password"
              name="password"
              placeholder="Enter your Password" onChange={(e)=>setValues({...values,[e.target.name]: e.target.value})} />
          </div>

          <button type="submit">Sublimt</button>
          <span className="Log">
            New User ? <Link to="/register">Register</Link>{" "}
          </span>
        </form>
        <ToastContainer />
      </div>
    </div>
    
  );
}

export default Login;
